angular.module('screenshot', [])
        .controller('screenshotController', ['$scope', '$http', function ($scope, $http) {
                $scope.b64Image = {
                    Height: 240,
                    Width: 320,
                    Data: "data:image/jpeg;base64,"
                };
                $scope.liveScreenActive = false;
                $scope.setTimeoutId = null;

                $scope.getScreenshot = function (live) {
                    //console.log($('div.ng-scope').width()-15);
                    $http.get('/api/screenshot', {
                        params: {
                            TYPE: "SCREENSHOT",
                            WIDTH: $('div.ng-scope').width() - 15
                        }
                    })
                            .then(function (resp) {
                                $scope.b64Image = resp.data;
                                console.log($('#statusScreenShoot'));
                                $('#statusScreenShoot').css("width", resp.data.Width);
                                $('#statusScreenShoot').css("height", resp.data.Height);

                                if (live === true) {
                                    $scope.setTimeoutId = setTimeout($scope.getLiveScreen(), 2000);
                                }
                            }, function (err) {
                                dialogs.error(
                                        'Error.',
                                        'Error no controlado.<br>' +
                                        JSON.stringify(err.data),
                                        {animation: true, backdrop: true, keyboard: true, windowClass: 'full-center', size: 'sm'}
                                );
                            });
                };

                $scope.getLiveScreen = function () {
                    //$('#statusScreenShoot').attr("src", "/api/screenshot?TYPE=LIVESCREEN");
                    if ($scope.liveScreenActive === true)
                    {
                        $scope.getScreenshot(true);
                    }
                };

                $scope.init = function () {
                    $('#RefreshBtn').on("click", function (event) {
                        $scope.getScreenshot();
                    });

                    $('#LiveScreenBtn').on("click", function (event) {
                        if ($scope.liveScreenActive === false)
                        {
                            $scope.liveScreenActive = true;
                            $('#RefreshBtn').attr("disabled", "disabled");
                            $('#LiveScreenBtn').html('STOP LIVESCREEN');
                            $scope.getLiveScreen();
                        } else
                        {
                            $scope.liveScreenActive = false;   
                            clearTimeout($scope.setTimeoutId);
                            $('#RefreshBtn').removeAttr('disabled');
                            $('#LiveScreenBtn').html('LIVESCREEN');
                        }
                    });

                    $scope.getScreenshot();
                };
                //INIT DISPLAY
                $scope.init("");
            }]);